// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC20/IERC20Upgradeable.sol";
import "../libraries/FunLibAsset.sol";
import "../tokens/FunNFT.sol";

contract TransferExecutor is OwnableUpgradeable {

    mapping (address => bool) private _paymentWhitelist;

    event PaymentTokenWhitelistChanged(address indexed paymentToken, bool value);
    event Transfer(FunLibAsset.Asset asset, address from, address to);

    function setWhitelistedPaymentToken(address paymentToken, bool value) external onlyOwner {
        _paymentWhitelist[paymentToken] = value;

        emit PaymentTokenWhitelistChanged(paymentToken, value);
    }

    function isWhitelist(address token) public view returns (bool){
        return _paymentWhitelist[token];
    }

    function transferEth(address to, uint value) internal {
        (bool success,) = to.call{ value: value }("");
        require(success, "transfer failed");
    }

    function _transferERC20(address from, address to, uint256 amount, address token) internal {
        require(isWhitelist(token), "Wrong purchase method.");
        IERC20Upgradeable(token).transferFrom(from, to, amount);
    }

    function _transferNft(address from, address to, address tokenAddress, uint256 tokenId) internal {
        FunNFT token = FunNFT(tokenAddress);
        token.safeTransferFrom(from, to, tokenId);
    }

    function _transferAssetFrom(address from, address to, FunLibAsset.Asset memory asset) internal {
        if (asset.assetType.assetClass == FunLibAsset.ETH_ASSET_CLASS) {
            transferEth(to, asset.value);
        }
        else if (asset.assetType.assetClass == FunLibAsset.ERC20_ASSET_CLASS) {
            _transferERC20(from, to, asset.value, asset.assetType.tokenAddress);
        }
        else {
            _transferNft(from, to, asset.assetType.tokenAddress, asset.assetType.tokenId);
        }

        emit Transfer(asset, from, to);
    } 
}
